import os
os.chdir('./OpenPrompt')

from datasets import load_dataset
from openprompt import PromptForClassification
from openprompt.data_utils import InputExample
from openprompt.plms import load_plm
from openprompt.prompts import ManualTemplate
from openprompt.prompts import ManualVerbalizer
import torch
from transformers import  AdamW, get_linear_schedule_with_warmup

"""## In this scripts, you will learn
### 1. how to use integrate huggingface datasets utilities into openprompt to   enable prompt learning in diverse datasets.
### 2. How to instantiate a template using a template language
### 3. How does the template wrap the input example into a templated one.
### 4. How do we hide the PLM tokenization details behind and provide a simple tokenization
### 5. How do construct a verbalizer using one/many label words
### 5. How to train the prompt like a traditional Pretrained Model.

"""

# load dataset
raw_dataset = {}
raw_dataset['train'] = load_dataset("copenlu/fever_gold_evidence", split='train')
raw_dataset['validation'] = load_dataset("copenlu/fever_gold_evidence", split='validation')
raw_dataset['test'] = load_dataset("copenlu/fever_gold_evidence", split='test')


# print(raw_dataset['train'])
label_mapping = {"SUPPORTS": 0, "REFUTES": 1, "NOT ENOUGH INFO": 2}
dataset = {}
for split in ['train', 'validation', 'test']:
    dataset[split] = []
    for data in raw_dataset[split]:
      # print(data['evidence'][0])
      input_example = InputExample(text_a='[SEP]'.join(data['evidence'][0]), text_b=data['claim'], label=label_mapping[data['label']])
      dataset[split].append(input_example)

# You can load the plm related things provided by openprompt
plm, tokenizer, model_config, WrapperClass = load_plm("bert", "bert-base-uncased")

# Constructing Template
template_text = '{"placeholder":"text_a"} Question: {"placeholder":"text_b"}? Is it correct? {"mask"}.'
mytemplate = ManualTemplate(tokenizer=tokenizer, text=template_text)

# # To better understand how does the template wrap the example, we visualize one instance.
# print(dataset['train'][0])
# wrapped_example = mytemplate.wrap_one_example(dataset['train'][0])
# # print(wrapped_example)
#
# # Now, the wrapped example is ready to be pass into the tokenizer, hence producing the input for language models.
# # You can use the tokenizer to tokenize the input by yourself, but we recommend using our wrapped tokenizer, which is a wrapped tokenizer tailed for InputExample.
# # The wrapper has been given if you use our `load_plm` function
#
# wrapped_tokenizer = WrapperClass(max_seq_length=128, decoder_max_length=3, tokenizer=tokenizer,truncate_method="head")
#
